import React from 'react';
import { Bar } from 'react-chartjs-2'; // Import the Bar chart component
import '../css/StatisticalData.css';
import Navbar from '../components/Navbar';

function StatisticalData() {
    // Sample data for the chart (You can replace it with dynamic data later)
    const chartData = {
        labels: ['New Customers', 'Service Providers'],
        datasets: [{
            label: 'Registrations',
            data: [12, 5], // Example data: 12 new customers and 5 service providers
            backgroundColor: [
                'rgba(105, 42, 178, 0.5)',
                'rgba(255, 99, 132, 0.5)'
            ],
            borderColor: [
                'rgba(105, 42, 178, 1)',
                'rgba(255, 99, 132, 1)'
            ],
            borderWidth: 1
        }]
    }

    return (
        <>
            <Navbar />
            <br /><br />
            <div className='header-container'>
                <h2>Statistical Data</h2>
            </div>

            <div className="table-container">
                {/* Render the bar chart */}
                <Bar 
                    data={chartData}
                    options={{
                        responsive: true,
                        scales: {
                            y: {
                                beginAtZero: true,
                                ticks: {
                                    stepSize: 1 // This will force the scale to begin at zero
                                }
                            }
                        }
                    }}
                />
            </div>

            <br /><br />
            <div className='header-container'>
                <p className="text-sm text-white">&copy; {new Date().getFullYear()} Developed by MaidEase. All rights reserved.</p>
            </div>
        </>
    );
}

export default StatisticalData;
